import React from "react";
import { Card, Button } from 'react-bootstrap';

function Dayquote({ quote }) {
  return (
    <div>
        <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src="data:image/jpeg;base64," />
          <Card.Body>
            <Card.Title>{quote.anime}: {quote.character}</Card.Title>
            <Card.Text>
              {quote.quote}
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
    </div>
  );
}

export default Dayquote;
